from disnake.ext import commands, tasks
import inspect
# for shufflemancy
from async_spotify import SpotifyApiClient
#from async_spotify.authentification import SpotifyAuthorisationToken
from async_spotify.authentification.authorization_flows import ClientCredentialsFlow
from decouple import config

# spotify client
auth_flow = ClientCredentialsFlow(
                            application_id=config('spotify_id'),
                            application_secret=config('spotify_secret'))


class UncatDataCog(commands.Cog):

    def __init__(self, bot):
        self.bot = bot
        self.update_spotify_token.start()  # starts the task loop

    # create the api client
    spotify_client = SpotifyApiClient(auth_flow)  # hold_authentication=True holds the token in memory until it expires

    async def cog_load(self):
        # see spotify_client_func
        await UncatDataCog.spotify_client.get_auth_token_with_client_credentials()
        # And start making requests
        await UncatDataCog.spotify_client.create_new_client()

    # if the cog is unloaded, close spotify client
    async def cog_unload(self):
        await UncatDataCog.spotify_client.close_client()
        self.update_spotify_token.cancel()

    # task refreshes the Spotify token every 60 minutes
    @tasks.loop(minutes=60)  # loops command every x minutes, 360=6 hrs
    async def update_spotify_token(self):
        await UncatDataCog.spotify_client.get_auth_token_with_client_credentials()  # refresh token

